$ = require('jquery'),
    global.jQuery = $,
    iFrameResize = require('iframe-resizer'),
    require("./vendor/materialize.min.js"),
    Dropkick = require("./vendor/dropkick"),
    rateyo = require('./vendor/jquery.rateyo'),
    urlize = require('urlize').urlize,
    require("./vendor/jquery-ui"),
    analytics = require('ga-browser')(),
    _ = require('underscore'),
    jdenticon = require("jdenticon"),
    md5 = require('md5'),
    moment = require('moment'),
    emojione = require("emojione"),
    //declare comentarismo api funcs
    analytichelper = require("./funcs/analytics-helper"),
    recohelper = require("./funcs/reco-helper"),
    container = require('./funcs/container.js'),
    count_api = require('./funcs/count_api.js'),
    count_elk = require('./funcs/count_elk.js'),
    create_ = require('./funcs/create.js'),
    delete_ = require('./funcs/delete_.js'),
    dislike = require('./funcs/dislike.js'),
    like = require('./funcs/like.js'),
    form_ = require('./funcs/form_.js'),
    load_api = require('./funcs/load_api.js'),
    load_elk = require('./funcs/load_elk.js');

var getIndexFromPath = function getIndexFromPath(index) {
    var path = window.location.pathname.split('/');
    return path[index];
};

var getUrlVars = function getUrlVars() {
    var vars = [], hash;
    var hashes = window.location.href.slice(window.location.href.indexOf('?') + 1).split('&');
    for (var i = 0; i < hashes.length; i++) {
        hash = hashes[i].split('=');
        vars.push(hash[0]);
        vars[hash[0]] = hash[1];
    }
    return vars;
};


