Comentarismo.prototype.onSubmitCommentForm = function (evt) {
    evt.stopPropagation();
    evt.preventDefault();

    var that = this;

    var urlTarget = that.host + '/auth/new' + '?db=' + (that.forum ? that.forum : '') + "&table=" + (that.table ? that.table : '')

    ga('send', 'event', 'onSubmitCommentForm', urlTarget, page, 0);

    var form = evt.currentTarget.form;

    if (!form || !form.captchaid) {
        form = this.commentForm[0];
    }

    //TODO: bind the value here
    var image = $('meta[property="og:image"]',(parent.document ? parent.document : document)).attr('content');
    var title = document.title || $('meta[property="og:title"]',(parent.document ? parent.document : document)).attr('content');
    var rating = 0;
    var js = {
        page: page,
        titleurlize: urlize(title),
        title: title,
        image: image,
        captchasolution: form.captchasolution.value,
        captchaid: form.captchaid.value,
        comment: form.body.value,
        operator: operator,
    };

    if (window.debug) {
        console.log("onSubmitCommentForm, ", js);
    }

    var formid = form.formid;

    var successbox = $(".success");

    if (formid && formid.value) {
        js.inreplyto = formid.value;
        //successbox = $("#" + formid.value + "-success");
        // errorbox = $("#" + formid.value + "-error");
    } else {
        rating = $("#comment-rating").rateYo("rating");
        js.rating = rating;
    }

    var request = $.ajax({
        url: urlTarget,
        type: 'post',
        dataType: 'json',
        data: js,
        headers: {"COMENTARISMO-KEY": that.key},
        xhrFields: {
            withCredentials: true
        }
    });

    request.done(function (data, textStatus, jqXHR) {
        if (window.debug) {
            console.log("onSubmitCommentForm, ", jqXHR);
        }
        if (that.mobile) {
            alertMsg = $.i18n._('hasbeenprocessed')
        } else {
            alertMsg = $.i18n._('hasbeenprocessed')
        }
        that.showAlertMessage(alertMsg, $(".error"));


        $('#new-todo').val('');
        $('#captchasolution').val('');

        var commentForm = $('#comment-form');
        commentForm.addClass('hidden');
        $(".form-wrapper").detach();

    });
    var alertMsg;
    request.fail(function (jqXHR) {
        if (jqXHR.status === 200) {
            if (that.mobile) {
                alertMsg = $.i18n._('hasbeenprocessed')
            } else {
                alertMsg = $.i18n._('hasbeenprocessed')
            }
            that.showAlertMessage(alertMsg, $(".error"));


            $('#new-todo').val('');
            $('#captchasolution').val('');

            var commentForm = $('#comment-form');
            commentForm.addClass('hidden');
            $(".form-wrapper").detach();

        } else if (jqXHR.status === 400) {
            successbox.hide();
            if (that.mobile) {
                alertMsg = $.i18n._('wrongcaptchasolution')
            } else {
                alertMsg = $.i18n._('wrongcaptchasolution')
            }
            that.showAlertMessage(alertMsg, $(".error"));


            $('#captchasolution').val('');
        } else if (jqXHR.status === 406) {
            successbox.hide();
            if (that.mobile) {
                alertMsg = $.i18n._('youhavepostedthiscomment')
            } else {
                alertMsg = $.i18n._('youhavepostedthiscomment')
            }

            that.showAlertMessage(alertMsg, $(".error"));

            $('#captchasolution').val('');
        } else {
            successbox.hide();
            if (that.mobile) {
                alertMsg = $.i18n._('seemslikeyounotlogged') + ' <br> ' + $.i18n._('pleaselog') + '<br><a href="#" class="log-in">LOG IN</a>'
            } else {
                alertMsg = $.i18n._('seemslikeyounotlogged') + " <br> " + $.i18n._('pleaselog') + "<br><a href='" + that.host + "/login'>Login</a>'"
            }
            that.showAlertMessage(alertMsg, $(".error"));
        }
    });


};


