        if (options.url && options.url.indexOf("elk.") !== -1) {
            //skip elk operations
        } else {
            // if there is data being sent
            // add the sessionId to it
            if (options.data) {
                options.data += '&' + cookie;
            }

            // if there is no data being sent
            // create the data and add the sessionId
            else {
                options.data = cookie;
            }
        }

    });
};
