    var itwas;
    try {
        itwas = domTarget.html();
        var c = domTarget.text();
        if(img){
            c = c.replace(img,"");
        }
        var i = parseInt(c);
        if(isNaN(i)){
            i = 0;
        }
        c = parseInt(i) + 1;
        if(window.debug) {
            console.log("addCount, ",c);
        }
        domTarget.html("<i class='material-icons dp48'>"+img+"</i> " + c + "</a>");
    } catch (e) {
        if(window.debug) {
            console.log("addCount, ",e);
        }
    }
    return itwas
}

