function send(that, type, payload, operator) {
    new Fingerprint2().get(function (result, components) {
        payload.type = type;
        payload.fp = result;
        // payload.fingerprint = components;
        payload.key = that.key;
        payload.operator = operator;
        payload.url = document.location.href;
        payload.titleurlize = that.page;


        var request = $.ajax({
            url: that.analytics + '/analytics',
            type: 'POST',
            data: {track: payload},
            dataType: 'json',
            headers: {"COMENTARISMO-KEY": that.key},
        });

        request.done(function (data, textStatus, jqXHR) {
            if (window.debug) {
                console.log("Comentarismo Analytics OK ", data);
            }

        });
        request.fail(function (jqXHR) {
            if (window.debug) {
                console.log("ERROR: fail", jqXHR);
            }
        });
    });
}

