        'a.ua': 's',
        'akavita.by': 'z',
        'all.by': 'query',
        'aport.ru': 'r',
        'bigmir.net': 'q',
        'bing': 'q,',
        'gde.ru': 'keywords',
        'go.mail.ru': 'q',
        'gogo.ru': 'q',
        'google': 'q',
        'i.ua': 'q',
        'km.ru': 'sq',
        'liveinternet.ru': 'ask',
        'lycos': 'q',
        'meta.ua': 'q,',
        'msn': 'q',
        'nigma.ru': 's',
        'online.ua': 'q',
        'poisk.ru': 'text',
        'quintura.ru': 'request',
        'rambler': 'query',
        'search.com.ua': 'q',
        'search.qip.ru': 'query,',
        'search.ua': 'query',
        'search.ukr.net': 'search_query',
        'tut.by': 'query',
        'ukr.net': 'search_query',
        'webalta.ru': 'q',
        'yahoo': 'p',
        'yandex': 'text'
